import { Card } from "../Card";
import "./style.css";

export const List = ({ listTransactions }) => {
  return (
    <section className="section__cards">
      <div className="section__cards--btns">
      <h3 className="section__cards--title">Resumo financeiro</h3>
      <div>

      </div>
        <butto className="section__cards__btns--filter">Todos</butto>
        <butto className="section__cards__btns--filter">Entradas</butto>
        <butto className="section__cards__btns--filter">Despesas</butto>
      </div>
      {listTransactions.map((item, index) => (
          <Card
          key={index}
          description={item.description}
          type={item.type}
          value={item.value}
          />
          ))}
    </section>
  );
};

